import React, { Component } from 'react';
import { Form, Button } from 'react-bootstrap';
export default class Membership extends Component {
    constructor(props) {
        super(props);
        this.state = {
            singIn: {
                email: 'Hey',
                password: '',
            },
            singup: {
                firstname: '',
                lastname: '',
                email: '',
                password: '',
            }
        }
    }

    componentDidMount() {
        console.log(this.state.singIn);
        this.setState({
            singIn: {
                email: 'Dayı'
            }
        })
        console.log(this.state.singIn);
    }

    render() {
        return (
            <div className="membership">

                <Form className="login-form">
                    {/* <div>Login</div> */}
                    <Form.Group controlId="formBasicLoginEmail">
                        <div className="login-input">
                            <div className="login-text">Email address:</div>
                            <Form.Control type="email" autoComplete="username" placeholder="Enter email" />
                        </div>
                        <Form.Text className="text-muted">
                        </Form.Text>
                    </Form.Group>

                    <Form.Group controlId="formBasicLoginPassword">
                        <div className="login-input">
                            <div className="login-text">Password:</div>
                            <Form.Control type="password" autoComplete="current-password" placeholder="Password" />
                        </div>
                    </Form.Group>
                    <Form.Group controlId="formBasicCheckbox">
                        <Form.Check type="checkbox" label="Check me out" />
                    </Form.Group>
                    <Button variant="primary" type="submit">Log in</Button>
                </Form>

                <Form className="login-form">
                    {/* <div>Login</div> */}
                    <Form.Group controlId="formBasicFirstnameText">
                        <div className="login-input">
                            <div className="login-text">Firstname:</div>
                            <Form.Control type="text" placeholder="Firstname" />
                        </div>
                        <Form.Text className="text-muted">
                        </Form.Text>
                    </Form.Group>
                    <Form.Group controlId="formBasicLastnameText">
                        <div className="login-input">
                            <div className="login-text">Lastname:</div>
                            <Form.Control type="text" placeholder="Lastname" />
                        </div>
                        <Form.Text className="text-muted">
                        </Form.Text>
                    </Form.Group>
                    <Form.Group controlId="formBasicEmail">
                        <div className="login-input">
                            <div className="login-text">Email address:</div>
                            <Form.Control type="email" autoComplete="username" placeholder="Enter email" />
                        </div>
                        <Form.Text className="text-muted">
                        </Form.Text>
                    </Form.Group>
                    <Form.Group controlId="formBasicPassword">
                        <div className="login-input">
                            <div className="login-text">Password:</div>
                            <Form.Control type="password" autoComplete="current-password" placeholder="Password" />
                        </div>
                    </Form.Group>
                    <Button variant="primary" type="submit">Sing up</Button>
                </Form>

            </div>
        )
    }
}
